import base64, zlib, io
from PIL import Image

# 압축되어 있는 base64 인코딩된 이미지 데이터
data = ""

# base64 패딩이 부족할 경우 보충
while len(data) % 4 != 0:
    data += "="

# base64 디코딩 후 zlib 압축 해제
decoded = base64.b64decode(data)
decompressed = zlib.decompress(decoded)

# BytesIO 객체로 감싸서 이미지를 엽니다.
image = Image.open(io.BytesIO(decompressed))
image.show()  # 기본 이미지 뷰어로 표시